import { Card } from "react-bootstrap";


export default function ICard () {
    return (
        <Card style={{ width: '18rem', textAlign: 'center' }}>
        <Card.Body>
          <Card.Title>Qtd. Trabalhos</Card.Title>
          <Card.Text>
            5
          </Card.Text>
        </Card.Body>
      </Card>
    )
}
